import logo from './logo.svg';
import './App.css';
import Square from './Component/Square';

function App() {
  return (
    <div className="App">
     <div className="board">
      <h1 className="title">Let's Play<br/>
        Tic Tac Toe</h1>
       <div className="row">
        <Square 
        chooseSquare={handleClick}/>
        <Square />
        <Square />
       </div>
       <div className="row">
        <Square />
        <Square />
        <Square />
       </div>
       <div className="row">
        <Square />
        <Square />
        <Square />
       </div>
     </div>
    </div>
  );
}

export default App;
